EIT InnoEnergy is the innovation engine for sustainable energy across Europe. For us, true sustainability means an industry that’s commercially viable, endlessly innovative, and highly competitive. Operating at the centre of the energy transition, we build connections worldwide, bringing together innovators and industry, entrepreneurs and investors, graduates and employers.

→ Leading the central events function with the main goal of commercialising our start-ups;
→ Managing events strategy, planning and execution, including The Business Booster with 1 200+ attendees, Master School Connect event for 220 students, business webinars and project launch webinars;
→ Leading partnerships with suppliers and full logistics and technical production of events;
→ Pivoted to virtual events (TBB.Connect, Master School Connect) and webinars (educational webinars, business and project launch webinars).

In the 2019 Summer programme, I have conducted 5 successful Fellowship programs with outstanding reviews from partners, students and managers. My work revolved around mentoring students and designing their personal programmes to achieve the goals of the Fellowship, managing all suppliers and partners and optimising processes and costs.

→ Managed Summer 2019 US university programs in Croatia by designing students’ daily schedules, organizing leisure activities and mentoring students through everyday challenges;
→ Optimised program costs by 20% through budget analysis and negotiation with multiple partners and suppliers;
→ Conducted 5 successful Fellowship programs with outstanding reviews from partners, students and managers with an average NPS score above 85.

I managed B2B events sales processes from the research & prospecting phase, through negotiation, closing and to delivery of service. My role included both growing the portfolio and managing existing accounts, which challenged me to learn different ways of communicating with stakeholders. I exceeded new account acquisition targets by 15% quarterly, achieved 45% growth of the partner and customer portfolio while managing a portfolio of 100+ accounts. I often collaborated with the marketing team in enhancing client feedback tools which helped build strong relationships, achieve 30% higher retention rates and provide strong cross-selling and up-selling opportunities.

→ Extensive research ahead of each event with aim to reach relevant event partners and sponsors;
→ Managing a portfolio of 100+ partner accounts for international B2B conferences and business seminars - this included daily communication with C-Level Executives from international companies;
→ Maintaining client relationships with existing business partners;
→ Supervising training and development of sales performance within the team;
→ Coordinating the on-site logistics of events including venue set-up, registration process, pre-arranged 1-2-1 meetings and various other networking formats, roundtable discussions, sponsor presentations, exhibition area, lunch, event party;
→ Planning and execution of marketing activities.

Being part of the Proper team meant bringing to life events we saw were missing on the market. As a new player in the B2B events arena, we focused on niche industries and my role was to research the industry and market, manage suppliers and lead the sales of the event. Onboarded as a Sales Representative, I developed a strong sales directory, introducing our first ever event to an international audience. Having 250+ attendees, 15 sponsors and partners in the first edition was the first step to building one of the most insightful tourism conferences in the region.

→ Developed databases of event sponsorship and partnership prospects;
→ Secured 15 event partners and sponsors;
→ Handled client communication and ticket sales;
→ Coordinated the on-site logistics, including venue set-up, registration process, sponsor presentations, exhibition area and lunch;
